		<script type="text/javascript">
		

			var visualizadorMapa = (function() {
				"use strict"

				var apiDataAllPol = {
						controller: 'ConservacionPatrimonial',
						methods: {
							'count_poligonos': '',
			            	'all_poligonos_format': { data: ''},
			            	'json': ''
			            },
					},
					dataLimitsInit = 0,
					dataQuantityInit = 4000,
					apiJsonAllPol,
					apiDataPolFilter = {
						controller: 'ConservacionPatrimonial',
						methods: {
			            	'poligonos_by_filter_format': { data: ''},
			            	'json': ''
			            },
					},
					dataFilter = {},
					dataTotal,
					apiJsonAlPol,
					filter_alcaldia = $(".filter-alcaldias"),
					x = 0,
				    inserts = 0,
				    rango,
				    id_source_collection = { type: 'FeatureCollection', features: [] };

				var getInitResponse = function(json, init, quantity) {
					console.log("befioreeee");
					
					setTimeout(function() {
		              	mainCP.getPoligonShapes(1349);
		            }, 2000);
					return;
					apiDataAllPol.methods.all_poligonos_format.data = { init: init, quantity: quantity };
					mainCP.apiCall(json).then(function(res){
						/*console.log("res");
						console.log(res);*/
						//return;
						if (!res.allPoligonosFormat) {
							return;
						}

						apiJsonAllPol = res.allPoligonosFormat.features;
						id_source_collection.features = id_source_collection.features.concat(apiJsonAllPol);

						if (init == 0) {
							mainCP.selectAlcaldia();
							mainCP.selectCatastral();
							mainCP.selectColonia();
							mainCP.selectInstitucion();
							dataTotal = res.countPoligonos;
							rango = (dataQuantityInit*100)/dataTotal;
							delete apiDataAllPol.methods.count_poligonos;
							mainCP.getPoligonShapes(id_source_collection);
						}else {
							mainCP.getPoligonShapesAddLoop(id_source_collection);
						}

						var nyDataLimitsInit = init + quantity;
						getInitResponse(json, nyDataLimitsInit, quantity);
						begin();
					}, function(reason, json){
						console.log("non");
					 	mainCP.debugThemes(reason, json);
					});
				}

				var begin = function() {
		        	x+= rango;
		            if (x >= 100) {
		            	$('#progress_bar .ui-progress').animateProgress(100, function() {
		            		$('.content_success').show("slide", {direction: 'up'}, 1000);
		            		$('.ui-progress-bar').hide("slide", {direction: 'down'}, 1000);
				        });
		            }else {
		            	$('#progress_bar .ui-progress').animateProgress(x, function() {
				        });
		            }
			    }

			    var getAlcaldiasRequest = function(json, init, quantity, id_al) {
			    	apiDataPolFilter.methods.poligonos_by_alcaldia_format = id_al + ', ' + init + ', ' + quantity;
			    	mainCP.apiCall(json).then(function(res){
			        	if (!res.allPoligonosByAlcaldiaFormat) {
							return;
						}

						apiJsonAllPol = res.allPoligonosFormat.features;
						id_source_collection.features = id_source_collection.features.concat(apiJsonAllPol);

			        	var nyDataLimitsInit = init + quantity;	// 2->50000  3->100000
						init = init + 50000;
						getAlcaldiasRequest(json, nyDataLimitsInit, quantity, id_al);
						mainCP.getPoligonShapes(apiJsonAlPol);
					}, function(reason, json){
					 	mainCP.debugThemes(reason, json);
					});
			    }

			    var updateNyMap = function(x) {
                    mainCP.getPoligonShapesAddLoop(null);
			    }

				var restablecer =function() {
					
				}

				var searchByFilter =function() {
					$(".ficha-content").removeClass("show-f");
					addLoadingFilterWaiting();
					if (!getTextValues()) { mainCP.mapFlyTo(-99.1344835, 19.4288867, 11); removeLoadingFilterWaiting(); return; }
					id_source_collection_filter.features = [];
					requestByFilter(dataLimitsInit, dataQuantityInit);
				}

				var id_source_collection_filter = { type: 'FeatureCollection', features: [] };

				var requestByFilter =function(init, quantity) {
					dataFilter.init = init;
					dataFilter.quantity = quantity ;
					apiDataPolFilter.methods.poligonos_by_filter_format.data = dataFilter;
					/*console.log("apiDataPolFilter storm");
			    	console.log(apiDataPolFilter);*/
			    	mainCP.apiCall(apiDataPolFilter).then(function(res){
			    		console.log("res storm");
			    		console.log(res);
			        	if (!res.allPoligonosByFilterFormat) {
			        		removeLoadingFilterWaiting();
			        		if (init == 0) {
			        			$.confirm({
								    title: 'No hemos encontrado ningún registro que coincida con el criterio de búsqueda',
								    content: '<div class="no-consejos-tit">CONSEJOS DE BÚSQUEDA:</div><ul><li>Use el filtro de Alcaldía y luego use los filtros del domicilio para limitar los resultados.</li><li>Reduzca la cantidad de palabras clave utilizadas o use palabras más generales.</li></ul>',
								    columnClass: 'col-md-4 no-result-confirm',
								    buttons: {
								        X: function () {
								        },
								    },
								    onContentReady: function () {
								    }
								});
			        		}
							return;
						}
						apiJsonAllPol = res.allPoligonosByFilterFormat.features;
						id_source_collection_filter.features = id_source_collection_filter.features.concat(apiJsonAllPol);
						if (init == 0) {
							var nyPosition = res.allPoligonosByFilterFormat.position
							/*console.log("kixs");
							console.log(nyPosition);*/
							if (typeof dataFilter.id_alcaldia != 'undefined' && Object.keys(dataFilter).length == 3) {
								//console.log("if");
								$.each(mainCP.dAlcaldia(), function( i, v ) {
									if (dataFilter.id_alcaldia == v.id_alcaldia) {
										mainCP.mapFlyTo(v.y, v.x, v.zoom);
									}
								});
							}else if (typeof dataFilter.id_alcaldia != 'undefined' && typeof dataFilter.id_institucion != 'undefined') {
								//console.log("else if");
								$.each(mainCP.dAlcaldia(), function( i, v ) {
									if (dataFilter.id_alcaldia == v.id_alcaldia) {
										mainCP.mapFlyTo(v.y, v.x, v.zoom);
									}
								});
							}else if (typeof dataFilter.id_institucion != 'undefined' && Object.keys(dataFilter).length == 3) {
								//console.log("else if 2");
								mainCP.mapFlyTo(nyPosition[0], nyPosition[1], 11);
							} else {
								//console.log("else");
								mainCP.mapFlyTo(nyPosition[0], nyPosition[1], 13);
							}
						}
						mainCP.getPoligonShapesAddLoop(id_source_collection_filter);
						var nyDataLimitsInit = init + quantity;
						requestByFilter(nyDataLimitsInit, quantity);
					}, function(reason, json){
					 	mainCP.debugThemes(reason, json);
					});
				}

				var showFilterDom = function() {
					$(".filter-sec-domicilio").slideToggle(1000, function() {
					    $(".filter-domicilio i").toggleClass('turn');
					 });
				}

				var addLoadingFilterWaiting = function() {
					$('.filter-form').addClass('loading-filter');
				}

				var removeLoadingFilterWaiting = function() {
					$('.filter-form').removeClass('loading-filter');
				}

				var getTextValues = function() {
					dataFilter = {};
					var formJson = $('form').serializeArray();
					$.each(formJson, function( i, v ) {
						if (v.value != '' && v.value != 'get-all-data-1349') {
							dataFilter[v.name] = v.value;
						}
					});
					if (Object.keys(dataFilter).length == 0) {
						mainCP.getPoligonShapesAddLoop(id_source_collection);
						return false;
					}
					return true;
				}

				var showFirstPart = function(x) {
					$('.btn-content-1.hide-ficha').toggleClass("hide-ficha");
					$('.btn-content-2').toggleClass("hide-ficha");
					$('.f-part-2').toggleClass("f-hide");

					$('.btn-content-1').removeClass("hide-ficha");
					$('.f-part-1').removeClass("f-hide");

					
					$('.zoom-pic').removeClass('disable-zoom-plus');
					$('.minus-zoom-pic').removeClass('enable-zoom-minus');
				}

				var showSecondPart = function(x) {
					$('.btn-content-2.hide-ficha').toggleClass("hide-ficha");
					$('.btn-content-1').toggleClass("hide-ficha");
					$('.f-part-1').toggleClass("f-hide");

					$('.btn-content-2').removeClass("hide-ficha");
					$('.f-part-2').removeClass("f-hide");

					//mainCP.swiperFotos(2);
				}

				var closeFicha = function() {
					$(".ficha-content").removeClass("show-f");
					var center = mainCP.centerBack();
					/*console.log("center");
					console.log(center);*/
					mainCP.mapFlyTo(center[0], center[1], 15);
					noneZoomPic();
				}

				var noneZoomPic = function() {
					$('.foto-swiper-effect').removeClass('zoom-active');
					$('.zoom-pic').removeClass('disable-zoom-plus');
					$('.minus-zoom-pic').removeClass('enable-zoom-minus');
				}

				var zoomPic = function() {
					$('.foto-swiper-effect').addClass('zoom-active');
					$('.zoom-pic').addClass('disable-zoom-plus');
					$('.minus-zoom-pic').addClass('enable-zoom-minus');
				}

			    var bindFilters = function() {
			        mainCP.bindMapBtn();
			        $(".restablecer").on('click', restablecer);
			        $(".search-by-filter").on('click', searchByFilter);
			        $(".filter-domicilio").on('click', showFilterDom);
			        $(".zoom-pic").on('click', zoomPic);
			        $(".minus-zoom-pic").on('click', noneZoomPic);
			        $(document).on('click', '.btn-content-1.hide-ficha', showFirstPart);
			        $(document).on('click', '.btn-content-2.hide-ficha', showSecondPart);
			        $(document).on('click', '.close-f', closeFicha);
			    };

				var init = function () {
					console.log("beeeeottt");
					$('#progress_bar .ui-progress .ui-label').hide();
		        	$('#progress_bar .ui-progress').css('width', '0%');
					bindFilters();
			        getInitResponse(apiDataAllPol, dataLimitsInit, dataQuantityInit);
			    };

				return {
				    init : init,
				    showFirstPart: showFirstPart,
				    searchByFilter: searchByFilter,
				}
			})();

			var mainCP = (function() {
				"use strict"

				var apiJson = {
						controller: 'ConservacionPatrimonial',
						methods: {
			            	'alcaldias': '',
			            	'colonias': '',
			            	'cuenta_catastral': '',
			            	'instituciones': '',
