				var objFormatDiv = function(x) {
					var str = "<div class='auto-content'>";
					$.each(x, function( k, v ) {
						str+= "<div><a target='_blank' href='/centro/micrositios/conservacion-patrimonial/autorizaciones/" +  v.nombre_archivo + "'>" + v.institucion + "</a></div>";
					});
					str+="</div>";
					return str;
				}

				var resolveResolucion = function(x) {
					var str = "<div class='auto-content'>";
					$.each(x, function( k, v ) {
						str+= "<div><a target='_blank' href='/sasd02/ficheros/acuerdos/ac_pub/" +  v.nom_fichero + "'>" + v.nom_fichero + "</a></div>";
					});
					str+="</div>";
					return str;
				}

				var lengthFormat = function(x, y, l) {
					var z = $("#" + x).html("");
					if (y) {
						if (y.length > l) {
							//$('<i class="fa fa-plus-circle more-card-data"></i><span class="full-card-data">' + y + '</span>').insertAfter(z.text(y));
							z.append($('<div/>', { class: 'content-more-card-data' }).text(y), [$('<i/>', { class: 'fa fa-plus-circle more-card-data' }), $('<span/>', { class: 'full-card-data' }).text(y)]);
						}else {
							z.text(y);
						}
					}else {
						z.text(none);
					}
				}

				var lengthFormatString = function(y, l) {
					var s;
					if (y.length > l) {
						s = '<div class="content-more-card-data">' + y + '</div><i class="fa fa-plus-circle more-card-data"></i><span class="full-card-data">' + y + '</span>';
					}else {
						s = y;
					}
					return s;
				}

				var hideEmptyRowLength = function(x, y) {
