						var str = "<div class='fuente-content'>";
						$.each(fuente, function( k, v ) {
							str+= "<div><a target='_blank' href='" +  v + "'>" + v + "</a></div>";
						});
						str+="</div>";
						z.html(lengthFormatString(str,str_len_cua));
					}else {
						z.closest("tr").addClass("none-row")
					}
				}

