					//str+="</div>";
					return str;
					
				}

				var ventana_ancho = $(window).width(), str_len_cin = 50, str_len_ses = 60, str_len_cua = 40;

		  		var doOneFicha = function(json) {
		  			if (ventana_ancho <= 600) {
		  				str_len_cin = 20, str_len_ses = 25, str_len_cua = 15;
		  			}
