			    var allPage = $('html, body');

			    var mapFlyTo = function(y, x, z, b, p) {

			    	//if (ventana_ancho <= 600) {
			    		//var winTam = ventana_ancho <= 600 ? 530 : ventana_ancho < 1680 ? 530 : 530;
						allPage.stop().animate({scrollTop: 490}, 1400);
			    	//}

			    	if (b > 0) {
			    		var beari = b,
			    			pit = p,
			    			offs = [300, 100];
			    		if (ventana_ancho <= 600) {
				    		offs = [10, 190];
				    	}
			    	}else {
			    		var beari = 0,
			    			pit = 0,
			    			offs = [0, 0];
			    	}
			    	map.flyTo({
						// These options control the ending camera position: centered at
						// the target, at zoom level 9, and north up.
						center: [ y, x ],
						zoom: z,
						bearing: beari,
						pitch: pit,
						offset: offs,
						 
						// These options control the flight curve, making it move
						// slowly and zoom out almost completely before starting
						// to pan.
						speed: 0.6, // make the flying slow
						//curve: 1, // change the speed at which it zooms out
						 
						// This can be any easing function: it takes a number between
						// 0 and 1 and returns another number between 0 and 1.
						easing: function(t) {
							return t;
						},
						 
						// this animation is considered essential with respect to prefers-reduced-motion
						essential: true
					});
			    }

				var map_mousemove = function(e) {
			    	map.getCanvas().style.cursor = 'pointer';
					if (e.features.length > 0) {
						if (hoveredStateId) {
							map.setFeatureState(
								{ source: 'diamolical-pal', id: hoveredStateId },
								{ hover: false }
							);
						}
						hoveredStateId = e.features[0].id;
						map.setFeatureState(
							{ source: 'diamolical-pal', id: hoveredStateId },
							{ hover: true }
						);
					}
				};

				var map_mouseleave =  function() {
					map.getCanvas().style.cursor = '';
					if (hoveredStateId) {
						map.setFeatureState(
							{ source: 'diamolical-pal', id: hoveredStateId },
							{ hover: false }
						);
					}
					hoveredStateId = null;
				};

